import { Platform, PermissionsAndroid, ToastAndroid } from 'react-native';
import RNHTMLtoPDF from 'react-native-html-to-pdf';
import Share from 'react-native-share';
import RNFS from 'react-native-fs';
import i18n from '../i18n';

interface PDFData {
  calculationResult: any;
  solutionType: 'solid' | 'liquid';
  preparatorName: string;
  preparationDate: Date;
  expirationDate: Date;
  chemical: any;
}

const formatDate = (date: Date): string => {
  const currentLanguage = i18n.language || 'en';
  const locale = currentLanguage === 'en' ? 'en-US' : 
                currentLanguage === 'fr' ? 'fr-FR' : 
                currentLanguage === 'ar' ? 'ar-SA' : 'en-US';
  
  return date.toLocaleDateString(locale, {
    year: 'numeric',
    month: 'long',
    day: 'numeric'
  });
};

const generateTimestamp = (): string => {
  const now = new Date();
  const year = now.getFullYear();
  const month = String(now.getMonth() + 1).padStart(2, '0');
  const day = String(now.getDate()).padStart(2, '0');
  const hours = String(now.getHours()).padStart(2, '0');
  const minutes = String(now.getMinutes()).padStart(2, '0');
  const seconds = String(now.getSeconds()).padStart(2, '0');
  return `${year}${month}${day}_${hours}${minutes}${seconds}`;
};

// Create embedded base64 strings for each logo
// These are dummy transparent placeholders - replace with your actual base64 encoded logo images
const fstLogoBase64 = 'data:image/png;base64,';
  
const fablabLogoBase64 = 'data:image/png;base64,';
  
